import React from 'react';
function ToDoItem(props) {
  let item = props.item;

  return (
    <div className="d-flex justify-content-between col-lg-7">
      {/* <div className="">
        <input id={item.id} type="checkbox" name="isDone" className="mr-1" />
        <label htmlFor={item.id}>{item.name}</label>
      </div>
      <div>{item.date}</div> */}
      {item.map((val,i)=>{
        return(<div>
          <input id={val.id} type="checkbox" name="isDone" className="mr-1" checked={val.completed} />
        <label htmlFor={val.id}>{val.item_name}</label>
        <div>{val.created_at}</div>
        </div>)

      })}
    </div>
  )
}

export default ToDoItem
